function renderBubble(text) {

  const selection = window.getSelection();
        const range = selection.getRangeAt(0);
        const rect = range.getBoundingClientRect();
        let x = rect.left ;
        let y = rect.top;
        console.log("Coordinates of selected text:", { x, y });
    
  
  
  // Check if bubble already exists
  let bubble = document.getElementById('bubble');
  // If bubble doesn't exist, create it
  if (!bubble) {
      bubble = document.createElement('button');
      bubble.id = 'bubble';
      bubble.classList.add('bubble');
      bubble.addEventListener('click', function() {
        showLoadingPopup()
        requestTokenization(text)
      });
      document.body.appendChild(bubble);
      
  }
  x=x-10
  y=y-40
  // Set the text content of the bubble
  bubble.textContent = "Validifi";
  // Set the position of the bubble
  bubble.style.position='fixed'
  bubble.style.border='round'
  bubble.style.background= 'validify.png'
  bubble.style.left = x + 'px' ;
  bubble.style.top = y + 'px';
  bubble.style.visibility = 'visible';
  bubble.style.color='red';
}


function requestTokenization(text) {
  chrome.runtime.sendMessage({ action: 'tokenize', text: text });
}

// Event listener to handle responses from the background page
chrome.runtime.onMessage.addListener(function(message, sender, sendResponse) {
  if (message.action === 'tokenizeResponse') {
    const vector = message.vector;
    console.log("'tokenizeResponse' recieved")
    sendTextToServer(text,vector)
  }
});

document.addEventListener('mouseup', function() {
  const selectedText = window.getSelection().toString().trim();
  if (selectedText) {
    renderBubble(selectedText);
  } else {
    // Hide the bubble if no text is selected
    let bubble = document.getElementById('bubble');
    if (bubble) bubble.style.visibility = 'hidden';
  }
});











