function predictC(vector,centroids) {
  
  let distances = [];

  for (let centroid of centroids) {
      distances.push(euclideanDistance(vector, centroid));
  }

  let minDistance = Math.min(...distances);
  let classification = distances.indexOf(minDistance);

  return [classification, minDistance];
}

// Function to calculate Euclidean distance between two points
function euclideanDistance(point1, point2) {
  let sumSquaredDiff = 0;

  for (let i = 0; i < point1.length; i++) {
      sumSquaredDiff += Math.pow((point1[i] - point2[i]), 2);
  }

  return Math.sqrt(sumSquaredDiff);
}


